import React from "react";
import './Servicos.css'

function Servicos(){
    return(
        <section className="servicos">
            <h1>Serviços</h1>
            <img src="/imagens/servs.jpg" id="a"/>

            <p id="html">Faço HTML, CSS e arranho um pouco no JS</p>
        
        </section>
        )
}

export default Servicos
